const makeFancyString = (s) => {
    let stringArray = s.split("")
    let running = true
    while (running) {
        let changed = false
        for (let i=0;i<stringArray.length-2; i++){
            if (stringArray[i]===stringArray[i+1] && stringArray[i]===stringArray[i+2]){
                stringArray.splice(i,1)
                changed = true
                break
            }
        }
        if (!changed){
            running = false
        }
    }
    return stringArray.join("")
};






console.log(makeFancyString("leeetcode"))
console.log(makeFancyString("aaabaaaa"))
console.log(makeFancyString("aab"))
console.log(makeFancyString(""))






